package cn.mxz.messagesender;import com.lemon.commons.socket.ISocket;import cn.javaplus.comunication.PacketCompressedByZlib;public class CornucopiaMessageSenderImpl implements CornucopiaMessageSender{	/**	 *	 */	public void notice(ISocket socket, String log) {		PacketCompressedByZlib p = new PacketCompressedByZlib();		p.putInt(80002);				p.putString("");		p.putString(log);		p.send(socket);	}}